import React from "react";

let styles = {
  textLeft: {
    color: "white", 
    fontSize: 25
  },
  textRight: {
    color: "white",
    fontSize: 25
  },
  textCenter: {
    color: "white",
    fontSize: 25
  },
  background: {
    background: "purple"
  }
}

const NavBar = () => {
  return <div className="navbar navbar-light bg-light" style={styles.background}>
    <div className="navbar-text float-right" href="#" style={styles.textLeft}>Clicky Game</div>
    <div className="navbar-text" href="#" style={styles.textCenter}>Message</div>
    <div className="navbar-text float-right" style={styles.textRight}>Score</div>
  </div>  
};

export default NavBar;
